response.activities:
Сначала мы предложим вам ответить на вопросы простенькой анкеты, распишем ваш ежедневный рацион питания.
Затем мы проведем необходимые измерения на АНАЛИЗАТОРЕ СТРУКТУРЫ ТЕЛА.

Это определение:
- процента мышечной массы;
- воды;
- костной массы;
- физического типа;
- скорость метаболизма;
- %жира + висцерального жира ( если есть- вокруг внутренних органов) в вашем организме;
- анализ покажет ваш БИОЛОГИЧЕСКИЙ ВОЗРАСТ (т.е. возрост на сколько сейчас себя чувствует и работает ваш организм);
- определим индивидуальный протеиновый фактор и скорость обмена веществ.

По результатам тестирования я расскажу, как использовать эти данные, для контроля веса и состояния вашего организма с помощью питания. При желании Вы сможете записаться на курс “Группа поддержки для желающих похудеть”.

Такая ОЦЕНКА ОРГАНИЗМА проводится БЕСПЛАТНО!!!

Если Вас заинтересовала данная процедура, то оставьте, пожалуйста, свой контактный телефон для связи, чтобы я мог назначить Вам встречу!
Работаю я строго по записи.
